/* eslint no-unused-vars: 0 */
import { html, svg, repeat, classMap, styleMap, ifDefined, unsafeHTML, scopeTag } from "@ui5/webcomponents-base/dist/renderer/LitRenderer.js";

const block0 = (context, tags, suffix) => html`<div class="ui5-sn-root">${ context.showHeader ? block1(context, tags, suffix) : undefined }${ context.items.length ? block2(context, tags, suffix) : undefined }<div class="ui5-sn-spacer"></div>${ context.fixedItems.length ? block6(context, tags, suffix) : undefined }</div> `;
const block1 = (context, tags, suffix) => html`<slot name="header"></slot>`;
const block2 = (context, tags, suffix) => html`<${scopeTag("ui5-tree", tags, suffix)} id="ui5-sn-items-tree" mode="None" ?_minimal="${ifDefined(context.collapsed)}" _toggle-button-end @ui5-item-click="${ifDefined(context.handleTreeItemClick)}">${ repeat(context._items, (item, index) => item._id || index, (item, index) => block3(item, index, context, tags, suffix)) }</${scopeTag("ui5-tree", tags, suffix)}>`;
const block3 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-tree-item", tags, suffix)} icon="${ifDefined(item.item.icon)}" .associatedItem="${ifDefined(item.item)}" text="${ifDefined(item.item.text)}" title="${ifDefined(item.item._tooltip)}" ?has-children="${item.item.items.length}" ?expanded="${item.item.expanded}" ?selected="${item.selected}">${ !context.collapsed ? block4(item, index, context, tags, suffix) : undefined }</${scopeTag("ui5-tree-item", tags, suffix)}>`;
const block4 = (item, index, context, tags, suffix) => html`${ repeat(item.item.items, (item, index) => item._id || index, (item, index) => block5(item, index, context, tags, suffix)) }`;
const block5 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-tree-item", tags, suffix)} .associatedItem="${ifDefined(item)}" text="${ifDefined(item.text)}" title="${ifDefined(item._tooltip)}" icon="${ifDefined(item.icon)}" ?selected="${item.selected}"></${scopeTag("ui5-tree-item", tags, suffix)}>`;
const block6 = (context, tags, suffix) => html`<div><div class="ui5-sn-bottom-content-border"><span></span></div><${scopeTag("ui5-tree", tags, suffix)} id="ui5-sn-fixed-items-tree" mode="None" ?_minimal="${ifDefined(context.collapsed)}" _toggle-button-end @ui5-item-click="${ifDefined(context.handleTreeItemClick)}">${ repeat(context._fixedItems, (item, index) => item._id || index, (item, index) => block7(item, index, context, tags, suffix)) }</${scopeTag("ui5-tree", tags, suffix)}></div>`;
const block7 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-tree-item", tags, suffix)} icon="${ifDefined(item.item.icon)}" .associatedItem="${ifDefined(item.item)}" text="${ifDefined(item.item.text)}" title="${ifDefined(item.item._tooltip)}" ?has-children="${item.item.items.length}" ?expanded="${item.item.expanded}" ?selected="${item.selected}">${ !context.collapsed ? block8(item, index, context, tags, suffix) : undefined }</${scopeTag("ui5-tree-item", tags, suffix)}>`;
const block8 = (item, index, context, tags, suffix) => html`${ repeat(item.item.items, (item, index) => item._id || index, (item, index) => block9(item, index, context, tags, suffix)) }`;
const block9 = (item, index, context, tags, suffix) => html`<${scopeTag("ui5-tree-item", tags, suffix)} .associatedItem="${ifDefined(item)}" text="${ifDefined(item.text)}" title="${ifDefined(item._tooltip)}" ?selected="${item.selected}"></${scopeTag("ui5-tree-item", tags, suffix)}>`;


export default block0;
